  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains geochemical data
  for unconsolidated sediments (stream sediments, lake sediments, etc.) collected
  by U.S. Geological Survey (USGS) personnel and analyzed in the analytical laboratories
  of the Geologic Division of the USGS. These data represent analyses of sediment
  samples collected in support of various USGS programs. The data were originally
  entered into the in-house Rock Analysis Storage System (RASS) database which was
  used by the Geologic Division from the early- 1970's through the late-1980's to
  archive geochemical data. An unpublished CD-ROM was developed in 1996 that contains
  the RASS data in GSSEARCH format. That CD was used to generate this data set.\",\n\t\"license_title\":
